import React, { useState, useRef, useEffect } from 'react';
import './Navbar.css';

const Navbar = () => {
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);
  const [isLoggedIn, setIsLoggedIn] = useState(false); // You can change this to true to test logged in state
  const [searchQuery, setSearchQuery] = useState('');
  const [isSearchOpen, setIsSearchOpen] = useState(false);
  const searchInputRef = useRef(null);

  const toggleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  const toggleLoginStatus = () => {
    setIsLoggedIn(!isLoggedIn);
  };

  const toggleSearch = () => {
    setIsSearchOpen((prev) => !prev);
  };

  useEffect(() => {
    if (isSearchOpen && searchInputRef.current) {
      searchInputRef.current.focus();
    }
  }, [isSearchOpen]);

  // Get current date
  const getCurrentDate = () => {
    const today = new Date();
    const options = { 
      weekday: 'long', 
      year: 'numeric', 
      month: 'long', 
      day: 'numeric' 
    };
    return today.toLocaleDateString('en-US', options);
  };

  const onSearchSubmit = (e) => {
    e.preventDefault();
    // Placeholder for future search behavior
    // console.log('Search:', searchQuery);
  };

  const onSearchKeyDown = (e) => {
    if (e.key === 'Escape') {
      setIsSearchOpen(false);
    }
  };

  return (
    <nav className="navbar">
      {/* Top Orange Bar */}
      <div className="top-bar">
        <div className="top-bar-container">
          {/* Left spacer (keeps center links centered) */}
          <div className="top-bar-left"></div>

          <div className="top-bar-center">
            <div className="top-bar-links">
              <a href="#students" className="top-link">STUDENTS</a>
              <span className="separator">|</span>
              <a href="#faculty" className="top-link">FACULTY & STAFF</a>
              <span className="separator">|</span>
              <a href="#about" className="top-link">ABOUT US</a>
              <span className="separator">|</span>
              <a href="#contact" className="top-link">CONTACT US</a>
            </div>
          </div>

          <div className="top-bar-right">
            <span className="date-text">Today is {getCurrentDate()}</span>
            <div className="login-section" onClick={toggleLoginStatus}>
              <div className="user-icon">
                <svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor" aria-hidden="true">
                  <path d="M12 12c2.21 0 4-1.79 4-4s-1.79-4-4-4-4 1.79-4 4 1.79 4 4 4zm0 2c-2.67 0-8 1.34-8 4v2h16v-2c0-2.66-5.33-4-8-4z"/>
                </svg>
              </div>
              <span className="login-text">
                {isLoggedIn ? 'LOG OUT' : 'LOG IN'}
              </span>
            </div>
          </div>
        </div>
      </div>

      {/* Main Green Navigation Bar */}
      <div className="main-nav">
        <div className="nav-container">
          {/* Logo and Brand */}
          <div className="brand">
            <div className="logo">
              <div className="logo-circle">
                <div className="logo-text">CITY COLLEGE OF BAYAWAN</div>
                <div className="logo-graphics">
                  <div className="logo-terraces"></div>
                  <div className="logo-gear"></div>
                </div>
              </div>
            </div>
            <div className="brand-text">
              <h1>CITY COLLEGE</h1>
              <h2>OF BAYAWAN</h2>
            </div>
          </div>

          {/* Mobile Menu Button */}
          <button className="mobile-menu-btn" onClick={toggleMobileMenu} aria-label="Toggle navigation menu">
            <span></span>
            <span></span>
            <span></span>
          </button>

          {/* Navigation Links */}
          <div className={`nav-links ${isMobileMenuOpen ? 'mobile-open' : ''}`}>
            <a href="#home" className="nav-link home-btn">
              <span className="nav-icon" aria-hidden="true">
                <svg viewBox="0 0 24 24" width="18" height="18" fill="currentColor"><path d="M12 3l9 8h-3v9h-5v-6H11v6H6v-9H3l9-8z"/></svg>
              </span>
              <span className="nav-label">HOME PAGE</span>
            </a>
            <a href="#academics" className="nav-link">
              <span className="nav-icon" aria-hidden="true">
                <svg viewBox="0 0 24 24" width="18" height="18" fill="currentColor"><path d="M12 3L1 9l11 6 9-4.91V17h2V9L12 3zm0 13L3.74 11 12 6.82 20.26 11 12 16z"/></svg>
              </span>
              <span className="nav-label">ACADEMIC PROGRAMS</span>
            </a>
            <a href="#admissions" className="nav-link">
              <span className="nav-icon" aria-hidden="true">
